import 'bootstrap/dist/css/bootstrap.css';


const LogIn = ({ username, password, onLogIn, onChange, text }) => (
    <div>
    <h1>Login</h1>
    <h4>{text}</h4>
    <br/>
    <label>Username</label><br/>
        <input value={username} onChange={e => onChange("username", e.target.value)} /><br/>
    <label>Password</label>
        <input value={password} onChange={e => onChange("password", e.target.value)} /><br/>
    <br/>
            <button type="submit" className="btn" onClick={onLogIn}>Login</button>
    </div>
);
export default LogIn;
